import React from "react";
import { Row, Col, Button } from "react-bootstrap";
function Home() {
  return (
    <Row>
      <Col
        md={6}
        className="d-flex flex-direction-column aligh-items-center justify-content-center"
      >
        <div>
          <h1>Chat with your friends right now!</h1>
        </div>
      </Col>
    </Row>
  );
}

export default Home;
